import React, { useEffect } from "react";
import Navigation from "./components/Navigation/Navigation";
import AOS from "aos";
import "bootstrap/dist/css/bootstrap.min.css";
import Footer from "./components/Footer/Footer";
import { Switch, Route, Redirect } from "react-router-dom";
import Home from "./components/Pages/Home";
import Blog from "./components/Pages/Blog";
import { useSelector, useDispatch } from "react-redux";
import { layoutActions } from "./components/redux-store/Store";
const App = () => {
  useEffect(() => {
    AOS.init({
      once: true,
      duration: 1000,
      offset: 120,
      delay: 200,
    });
  }, []);
  const dispatch = useDispatch();
  const isClicked = useSelector(state => state.layout.isClicked);
  const toggleHandler = () =>{
    dispatch(layoutActions.toggleLayout());
  }
  return (
    <>
      <LinkNavigation toggle={toggleHandler} transform={isClicked} />
      <Navigation />
      <Switch>
        <Route path='/'exact component={Home}/>
        <Route path='/admin'>
          <Home/>
        </Route>
        <Route path='/blogs'>
          <Blog/>
        </Route>
        <Route path='*'>
          <Redirect to='/'/>
        </Route>
      </Switch>
      <Footer />
    </>
  );
};

export default App;
